import React from "react";

export default function TableOfPromises(props) {
  async function joinablePromises() {
    return props.joinablePromises.map((promise) => {
      <tr>
        <td>{promise[0]}</td>
        <td>{promise[1]}</td>
        <td>{promise[2]}</td>
        <td>{promise[3]}</td>
        <td>{promise[4]}</td>
      </tr>;
    });
  }
  return (
    <table>
      <th>ID</th>
      <th>Asset A</th>
      <th>Amount A</th>
      <th>Asset B</th>
      <th>Amount B</th>
      {joinablePromises()}
    </table>
  );
}
